import{_ as o,c as i,o as a,aj as t}from"./chunks/framework.DRmbE9yB.js";const u=JSON.parse('{"title":"Google Service","description":"","frontmatter":{},"headers":[],"relativePath":"documentation/services/google-service.md","filePath":"documentation/services/google-service.md","lastUpdated":0}'),n={name:"documentation/services/google-service.md"};function s(l,e,r,c,h,g){return a(),i("div",null,[...e[0]||(e[0]=[t('<h1 id="google-service" tabindex="-1">Google Service <a class="header-anchor" href="#google-service" aria-label="Permalink to “Google Service”">​</a></h1><p>Connect multiple Google accounts with different permissions for Sheets and Gmail integration.</p><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to “Overview”">​</a></h2><p>The Google Service feature allows you to connect and manage multiple Google accounts within the extension. You can grant specific permissions for Google Sheets and Gmail access, enabling seamless integration with Google&#39;s services for automation workflows.</p><h2 id="key-features" tabindex="-1">Key Features <a class="header-anchor" href="#key-features" aria-label="Permalink to “Key Features”">​</a></h2><ul><li><strong>Multiple Account Support</strong> - Connect multiple Google accounts simultaneously</li><li><strong>Granular Permissions</strong> - Choose specific permissions for each account</li><li><strong>Google Sheets Access</strong> - Read and write spreadsheet data</li><li><strong>Gmail Access</strong> - Send and read emails programmatically</li><li><strong>Account Management</strong> - Easy connection and disconnection of accounts</li><li><strong>Permission Control</strong> - Enable/disable permissions as needed</li></ul><h2 id="connecting-a-google-account" tabindex="-1">Connecting a Google Account <a class="header-anchor" href="#connecting-a-google-account" aria-label="Permalink to “Connecting a Google Account”">​</a></h2><h3 id="step-1-access-google-service-settings" tabindex="-1">Step 1: Access Google Service Settings <a class="header-anchor" href="#step-1-access-google-service-settings" aria-label="Permalink to “Step 1: Access Google Service Settings”">​</a></h3><ol><li>Navigate to <strong>Services</strong> in the sidebar</li><li>Click on <strong>Google Service</strong></li><li>You&#39;ll see the Google Services page</li></ol><h3 id="step-2-select-permissions" tabindex="-1">Step 2: Select Permissions <a class="header-anchor" href="#step-2-select-permissions" aria-label="Permalink to “Step 2: Select Permissions”">​</a></h3><p>Choose the permissions you want to grant to your Google account. At least one permission must be selected.</p><h4 id="available-permissions" tabindex="-1">Available Permissions: <a class="header-anchor" href="#available-permissions" aria-label="Permalink to “Available Permissions:”">​</a></h4><p><strong>Google Sheets Access</strong></p><ul><li><strong>Permission</strong>: Read and write spreadsheets</li><li><strong>Use Case</strong>: Fetch data from Google Sheets, write automation results</li><li><strong>Field Types</strong>: Fetch Google Sheet Data</li></ul><p><strong>Gmail Access</strong></p><ul><li><strong>Permission</strong>: Send and read emails</li><li><strong>Use Case</strong>: Fetch emails, send automated emails, extract verification codes</li><li><strong>Field Types</strong>: Fetch Mail (Gmail), Fetch Single Mail (Gmail), Send Mail (Gmail)</li></ul><h3 id="step-3-connect-account" tabindex="-1">Step 3: Connect Account <a class="header-anchor" href="#step-3-connect-account" aria-label="Permalink to “Step 3: Connect Account”">​</a></h3><ol><li>Select the desired permissions (Google Sheets Access and/or Gmail Access)</li><li>Click the <strong>&quot;Connect Google Account&quot;</strong> button</li><li>You&#39;ll be redirected to Google&#39;s authentication page</li><li>Sign in with your Google account</li><li>Grant the requested permissions</li><li>You&#39;ll be redirected back to the extension</li></ol><h2 id="connected-accounts" tabindex="-1">Connected Accounts <a class="header-anchor" href="#connected-accounts" aria-label="Permalink to “Connected Accounts”">​</a></h2><p>Once connected, your accounts will appear in the <strong>Connected Accounts</strong> section.</p><h3 id="account-information" tabindex="-1">Account Information <a class="header-anchor" href="#account-information" aria-label="Permalink to “Account Information”">​</a></h3><p>Each connected account displays:</p><ul><li><strong>Profile</strong> - Profile picture and initial</li><li><strong>Account</strong> - Name and email address</li><li><strong>Permissions</strong> - Active permissions (Sheets, Gmail)</li><li><strong>Connected</strong> - Connection date and time, expiration status</li><li><strong>Actions</strong> - Reconnect or disconnect options</li></ul><h3 id="account-status" tabindex="-1">Account Status <a class="header-anchor" href="#account-status" aria-label="Permalink to “Account Status”">​</a></h3><p><strong>Active Account:</strong></p><ul><li>Shows connection date and time</li><li>Displays active permissions as badges</li><li>Available for use in field types</li></ul><p><strong>Expired Account:</strong></p><ul><li>Shows &quot;Expired&quot; status</li><li>Requires reconnection</li><li>Click reconnect button to refresh permissions</li></ul><h2 id="managing-accounts" tabindex="-1">Managing Accounts <a class="header-anchor" href="#managing-accounts" aria-label="Permalink to “Managing Accounts”">​</a></h2><h3 id="reconnect-account" tabindex="-1">Reconnect Account <a class="header-anchor" href="#reconnect-account" aria-label="Permalink to “Reconnect Account”">​</a></h3><p>If an account expires or loses permissions:</p><ol><li>Click the <strong>reconnect button</strong> (green icon) next to the account</li><li>Re-authenticate with Google</li><li>Grant permissions again</li><li>Account will be refreshed</li></ol><h3 id="disconnect-account" tabindex="-1">Disconnect Account <a class="header-anchor" href="#disconnect-account" aria-label="Permalink to “Disconnect Account”">​</a></h3><p>To remove an account:</p><ol><li>Click the <strong>disconnect button</strong> (red icon) next to the account</li><li>Confirm disconnection</li><li>Account will be removed from the list</li></ol><h3 id="disconnect-all-accounts" tabindex="-1">Disconnect All Accounts <a class="header-anchor" href="#disconnect-all-accounts" aria-label="Permalink to “Disconnect All Accounts”">​</a></h3><p>To remove all connected accounts at once:</p><ol><li>Click the <strong>&quot;Disconnect All Accounts&quot;</strong> button (top right)</li><li>Confirm the action</li><li>All accounts will be disconnected</li></ol><h2 id="using-google-service-in-field-types" tabindex="-1">Using Google Service in Field Types <a class="header-anchor" href="#using-google-service-in-field-types" aria-label="Permalink to “Using Google Service in Field Types”">​</a></h2><h3 id="google-sheets-integration" tabindex="-1">Google Sheets Integration <a class="header-anchor" href="#google-sheets-integration" aria-label="Permalink to “Google Sheets Integration”">​</a></h3><p><strong>Field Types:</strong></p><ul><li><a href="/documentation/field-types/google-service-sheet/fetch-google-sheet-data.html">Fetch Google Sheet Data</a></li></ul><p><strong>Requirements:</strong></p><ul><li>Connected Google account with <strong>Google Sheets Access</strong> permission</li><li>Spreadsheet ID</li><li>Sheet name and range</li></ul><p><strong>Example Use Cases:</strong></p><ul><li>Import data from Google Sheets for form filling</li><li>Sync spreadsheet data with web forms</li><li>Use Google Sheets as a data source</li></ul><h3 id="gmail-integration" tabindex="-1">Gmail Integration <a class="header-anchor" href="#gmail-integration" aria-label="Permalink to “Gmail Integration”">​</a></h3><p><strong>Field Types:</strong></p><ul><li><a href="/documentation/field-types/google-service-gmail/fetch-mail-gmail.html">Fetch Mail (Gmail)</a></li><li><a href="/documentation/field-types/google-service-gmail/fetch-single-mail-gmail.html">Fetch Single Mail (Gmail)</a></li><li><a href="/documentation/field-types/google-service-gmail/send-mail-gmail.html">Send Mail (Gmail)</a></li></ul><p><strong>Requirements:</strong></p><ul><li>Connected Google account with <strong>Gmail Access</strong> permission</li><li>Search queries for fetching emails</li><li>Email content for sending</li></ul><p><strong>Example Use Cases:</strong></p><ul><li>Fetch verification codes from emails</li><li>Monitor inbox for specific messages</li><li>Send automated email notifications</li><li>Extract data from email content</li></ul><h2 id="permission-scopes" tabindex="-1">Permission Scopes <a class="header-anchor" href="#permission-scopes" aria-label="Permalink to “Permission Scopes”">​</a></h2><h3 id="google-sheets-access" tabindex="-1">Google Sheets Access <a class="header-anchor" href="#google-sheets-access" aria-label="Permalink to “Google Sheets Access”">​</a></h3><p><strong>Scopes Granted:</strong></p><ul><li><code>https://www.googleapis.com/auth/spreadsheets</code> - Read and write spreadsheets</li><li><code>https://www.googleapis.com/auth/drive.readonly</code> - View Google Drive files</li></ul><p><strong>What You Can Do:</strong></p><ul><li>Read data from any spreadsheet you have access to</li><li>Write data to spreadsheets</li><li>Create new spreadsheets</li><li>Update existing spreadsheet content</li></ul><h3 id="gmail-access" tabindex="-1">Gmail Access <a class="header-anchor" href="#gmail-access" aria-label="Permalink to “Gmail Access”">​</a></h3><p><strong>Scopes Granted:</strong></p><ul><li><code>https://www.googleapis.com/auth/gmail.readonly</code> - Read emails</li><li><code>https://www.googleapis.com/auth/gmail.send</code> - Send emails</li><li><code>https://www.googleapis.com/auth/gmail.modify</code> - Modify email labels</li></ul><p><strong>What You Can Do:</strong></p><ul><li>Read emails from inbox</li><li>Search emails with queries</li><li>Send emails programmatically</li><li>Mark emails as read/unread</li><li>Manage email labels</li></ul><h2 id="security-privacy" tabindex="-1">Security &amp; Privacy <a class="header-anchor" href="#security-privacy" aria-label="Permalink to “Security &amp; Privacy”">​</a></h2><h3 id="data-security" tabindex="-1">Data Security <a class="header-anchor" href="#data-security" aria-label="Permalink to “Data Security”">​</a></h3><ul><li><strong>OAuth 2.0 Authentication</strong> - Secure authentication using Google&#39;s OAuth 2.0</li><li><strong>Token Storage</strong> - Tokens are stored securely in the extension</li><li><strong>No Password Storage</strong> - Your Google password is never stored</li><li><strong>Revocable Access</strong> - You can revoke access anytime from Google Account settings</li></ul><h3 id="privacy" tabindex="-1">Privacy <a class="header-anchor" href="#privacy" aria-label="Permalink to “Privacy”">​</a></h3><ul><li><strong>Minimal Permissions</strong> - Only request permissions you need</li><li><strong>User Control</strong> - You control which accounts to connect</li><li><strong>No Data Sharing</strong> - Your data is not shared with third parties</li><li><strong>Local Processing</strong> - Data processing happens locally in your browser</li></ul><h3 id="revoking-access" tabindex="-1">Revoking Access <a class="header-anchor" href="#revoking-access" aria-label="Permalink to “Revoking Access”">​</a></h3><p>To revoke extension access from Google:</p><ol><li>Go to <a href="https://myaccount.google.com/permissions" target="_blank" rel="noreferrer">Google Account Permissions</a></li><li>Find &quot;Excellent Data Filler&quot; in the list</li><li>Click <strong>Remove Access</strong></li><li>Confirm revocation</li></ol><h2 id="best-practices" tabindex="-1">Best Practices <a class="header-anchor" href="#best-practices" aria-label="Permalink to “Best Practices”">​</a></h2><h3 id="✅-do-s" tabindex="-1">✅ Do&#39;s <a class="header-anchor" href="#✅-do-s" aria-label="Permalink to “✅ Do&#39;s”">​</a></h3><ul><li><strong>Use separate accounts</strong> - Use different Google accounts for different purposes</li><li><strong>Grant minimal permissions</strong> - Only enable permissions you need</li><li><strong>Monitor expiration</strong> - Reconnect accounts before they expire</li><li><strong>Test connections</strong> - Verify account access before automation</li><li><strong>Keep accounts organized</strong> - Use descriptive account names</li></ul><h3 id="❌-don-ts" tabindex="-1">❌ Don&#39;ts <a class="header-anchor" href="#❌-don-ts" aria-label="Permalink to “❌ Don&#39;ts”">​</a></h3><ul><li><strong>Don&#39;t share accounts</strong> - Each user should use their own Google account</li><li><strong>Don&#39;t grant unnecessary permissions</strong> - Only enable required permissions</li><li><strong>Don&#39;t ignore expiration</strong> - Reconnect expired accounts promptly</li><li><strong>Don&#39;t use personal accounts for automation</strong> - Consider using dedicated accounts</li><li><strong>Don&#39;t forget to disconnect</strong> - Remove unused accounts</li></ul><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to “Troubleshooting”">​</a></h2><h3 id="cannot-connect-account" tabindex="-1">Cannot Connect Account <a class="header-anchor" href="#cannot-connect-account" aria-label="Permalink to “Cannot Connect Account”">​</a></h3><p><strong>Solution:</strong></p><ul><li>Check your internet connection</li><li>Ensure pop-ups are allowed for the extension</li><li>Try a different browser or incognito mode</li><li>Clear browser cache and cookies</li></ul><h3 id="permission-denied-errors" tabindex="-1">Permission Denied Errors <a class="header-anchor" href="#permission-denied-errors" aria-label="Permalink to “Permission Denied Errors”">​</a></h3><p><strong>Solution:</strong></p><ul><li>Verify the account has the required permissions</li><li>Reconnect the account to refresh permissions</li><li>Check if the account has access to the resource (spreadsheet/email)</li></ul><h3 id="account-shows-as-expired" tabindex="-1">Account Shows as Expired <a class="header-anchor" href="#account-shows-as-expired" aria-label="Permalink to “Account Shows as Expired”">​</a></h3><p><strong>Solution:</strong></p><ul><li>Click the reconnect button</li><li>Re-authenticate with Google</li><li>Grant permissions again</li></ul><h3 id="cannot-access-spreadsheet-email" tabindex="-1">Cannot Access Spreadsheet/Email <a class="header-anchor" href="#cannot-access-spreadsheet-email" aria-label="Permalink to “Cannot Access Spreadsheet/Email”">​</a></h3><p><strong>Solution:</strong></p><ul><li>Verify the Google account has access to the resource</li><li>Check if the correct account is selected in field settings</li><li>Ensure permissions are granted correctly</li></ul><h2 id="related-documentation" tabindex="-1">Related Documentation <a class="header-anchor" href="#related-documentation" aria-label="Permalink to “Related Documentation”">​</a></h2><ul><li><a href="/documentation/field-types/google-service-sheet.html">Google Service - Sheet</a></li><li><a href="/documentation/field-types/google-service-gmail.html">Google Service - Gmail</a></li><li><a href="/documentation/field-types/google-service-sheet/fetch-google-sheet-data.html">Fetch Google Sheet Data</a></li><li><a href="/documentation/field-types/google-service-gmail/fetch-mail-gmail.html">Fetch Mail (Gmail)</a></li><li><a href="/documentation/field-types/google-service-gmail/fetch-single-mail-gmail.html">Fetch Single Mail (Gmail)</a></li><li><a href="/documentation/field-types/google-service-gmail/send-mail-gmail.html">Send Mail (Gmail)</a></li><li><a href="/documentation/form-fields/field-types.html">Field Types</a></li></ul>',92)])])}const m=o(n,[["render",s]]);export{u as __pageData,m as default};
